double dv;
public String double2String(double v,double divider){
 if(v>0)dv=0.5;
 else if(v<0)dv=-0.5;
 else dv=0;
 return (int)(v*divider+dv)/divider+"";
}

// this code has to do with displaying the number 2.3 instead of 2.300000001 when using % %

// actually getcurrent is getdsinomegatoverdt
public double getCurrent () {

  //angleFunction is name of the input field for 5*t for example
 double thetaMinus = _view.angleFunction.evaluate(t-dt); //angle at t-dt
 double thetaPlus = _view.angleFunction.evaluate(t+dt);  //angle at t+dt
 return (Math.sin(thetaPlus)-Math.sin(thetaMinus))/dt/2;  // central difference approximation
}

public double compute_Omega() {

double thetaMinus1 = _view.angleFunction.evaluate(t-dt); //angle at t-dt
 double thetaPlus1 = _view.angleFunction.evaluate(t+dt);  //angle at t+dt
 return ((thetaPlus1)-(thetaMinus1))/dt/2;  // central difference approximation
}

public double getAlpha (double cta) {
sign2=sign; //  keep the direction of force same. sign2 stored sign for force draw a2*sign2*3
sign3 = sign4;
//sign3 =sign; // sign3 stored sign for particle in battery wires
 if(!Is)sign=-sign; // boolean Is current state is not 0, sign =-sign
if(!Is)sign3=-sign3; // make sign3 flip if electron is selected

if (I>0){
sign4 = 1; // battery wire constant direction
}
else {
  sign4 = -1; // battery wire constant negative direction
}
if (splitring==true){

if(Math.cos(cta)>=0&&cta02pi<=cta2&&cta02pi<=pi/2&&cta02pi>=0) { //contact
sign=1; // 1stQ

return a2*Math.abs(Math.cos(cta));
}

else if (Math.cos(cta)<=0&&cta02pi>=pi-cta2&&cta02pi>=pi/2&&cta02pi<=pi) {
sign=-1; //2ndQ
//sign4 = 1;     
return a2*Math.abs(Math.cos(cta));
}

else if(Math.cos(cta)<=0&&cta02pi<=-pi-cta1&&cta02pi>=-pi&&cta02pi<=-pi/2) {
sign=-1; // 3rdQ
//sign4 = 1; 
return a2*Math.abs(Math.cos(cta));
}

else if (Math.cos(cta)>=0&&cta02pi>=cta1&&cta02pi>=-pi/2&&cta02pi<=0) {
sign=1; //4thQ
//sign4 = 1;  
return a2*Math.abs(Math.cos(cta));
}

else {
sign = 0; // no contact no magnetic force
sign4 = 0;
return 0;
      }

                  }
else {
//sign4 = 1; // for the particles on the battery wires direction of motion
return a2*(Math.cos(cta)); // for no split ring
  }

}

